description:
Alla vill ha en bit av Kat. Nu ar det Kats tur att bita ifran. New Yorks undre varld, kvarteret Hells Kitchen. Kat och Al ar stadens egna Bonnie &amp; Clyde, smagangstrar och vapensaljare i en varld dar synd har blivit den starsta religionen. Men nar Al i ett psykotiskt svartsjukeanfall misshandlar Kat rejalt, tar detta dod pa all romantik hon kant och hon bestammer sig ocksa for att ta dod pa Al. Hur? Genom att anvanda sina lips, hips och tits hittar hon snabbt nagra sammansvurna och det ar inledningen till en hamndaktion som endast en kvinna hade kunnat tanka ut......


